vertex.source:
//vertex position in world coordinates
attribute vec3 vertex_worldSpace;
//surface normal at the vertex in world coordinates
attribute vec3 normal_worldSpace;
//texture coordinates at that vertex
attribute vec2 textureCoordinate_input;

//model Matrix (Identity in our case)
uniform mat4 mMatrix;
//view Matrix
uniform mat4 vMatrix;
//projection Matrix
uniform mat4 pMatrix;

uniform mat2 textureMatrix;

varying vec4 vertex_camSpace;
varying vec4 normal_camSpace;
varying vec2 v_textureCoordinate;

//main program for each vertex
void main() {
  // calculate the view space matrix
  vertex_camSpace = vMatrix * mMatrix * vec4(vertex_worldSpace, 1.0);
  // calculate the normals
  normal_camSpace = vMatrix * mMatrix * vec4(normal_worldSpace, 0.0);
  // project on to the scene
  gl_Position = pMatrix * vertex_camSpace;

  vec2 repeated_Coord = vec2(mod(textureCoordinate_input.x, 3.0), mod(textureCoordinate_input.y , 3.0));
  v_textureCoordinate = (textureMatrix * repeated_Coord);
}

fragment.source:
//for better performance less precision
precision mediump float;

uniform sampler2D texture_sampler;
uniform sampler2D normal_sampler;
varying vec2 v_textureCoordinate;

// light source
uniform vec3 u_LightPos;
// colours for different components
uniform vec4 diffuse;
uniform vec4 specular;
uniform vec4 ambient;
uniform float shininess;

varying vec4 vertex_camSpace;
varying vec4 normal_camSpace;

//main program for each fragment = pixel candidate
void main() {
  // the vector representing the direction of light
  vec3 lightVector = normalize(u_LightPos - vec3(vertex_camSpace));
  vec4 mapped_normal = texture2D(normal_sampler, v_textureCoordinate);
  mapped_normal = normalize(mapped_normal * 2.0 - 1.0); 

  float distance = length(u_LightPos - vec3(vertex_camSpace));

  float diffuse_val = max(dot(vec3(mapped_normal), lightVector), 0.1);
  diffuse_val = max(diffuse_val * (1.0 / (1.0 + (0.25 * distance * distance))) * 300.0, 0.1);

  float reflect_light_dot = dot(normalize(reflect(lightVector, vec3(mapped_normal))), normalize(vertex_camSpace.xyz));
  float specular_val = pow(max(reflect_light_dot, 0.0), 0.3*shininess);

  vec4 v_Color = vec4(diffuse * diffuse_val * 0.5 + specular * specular_val * 0.7 + ambient);

  gl_FragColor = v_Color * texture2D(texture_sampler, v_textureCoordinate);
}

vertex.source:
//vertex coordinates in world space for the render quad
attribute vec3 vertex_worldSpace;
//texture coordinate for this vertex and the render quad
attribute vec2 textureCoordinate_input;

//texture coordinate needs to be passed on to the R2T fragment shader
varying vec2 varyingTextureCoordinate;

//main program for each vertex of the render quad
void main() {
  gl_Position = vec4(vertex_worldSpace, 1.0);
  varyingTextureCoordinate = textureCoordinate_input;
}

fragment.source:
precision mediump float;

//a texture sampling unit, which is bound to the render quad texture buffer
uniform sampler2D textureRendered;

//texture coordinates coming from the vertex shader, interpolated through the rasterizer
varying vec2 varyingTextureCoordinate;

//main program for each fragment of the render quad
void main() {
  gl_FragColor = texture2D(textureRendered, varyingTextureCoordinate.st);
}
